import java.util.Scanner;

public class CodeUp1073 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
		int n=sc.nextInt();;
		while(true) {
			if(n!=0) {
				 System.out.println(n);
				 n=sc.nextInt();
				
				 if(n==0) {
					 break;
				 }

	
		}
		}
	}
}



